import React from 'react';

const ReservarTaller = () => {
  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-100 p-4">
      {/* Contenedor principal (cuadrado) */}
      <div className="bg-white border-2 border-green-500 rounded-lg shadow-lg w-full max-w-md p-6">
        {/* Título */}
        <h1 className="text-2xl font-bold text-center mb-6 text-green-700">
          Reservar Taller
        </h1>

        {/* Sección del taller */}
        <div className="mb-6">
          <h2 className="text-xl font-semibold mb-2 text-gray-800">
            NOMBRE DEL TALLER
          </h2>
          <p className="text-gray-600 mb-4">
            Descripción del taller...
          </p>
        </div>

        {/* Botón de reserva */}
        <div className="flex justify-center">
          <button className="bg-green-600 hover:bg-green-700 text-white font-bold py-2 px-6 rounded-lg transition duration-200">
            Reservar Taller
          </button>
        </div>
      </div>
    </div>
  );
};

export default ReservarTaller;
